import React from 'react';
import ReactDom from 'react-dom';
import CommentDetail from './CommentDetail';

const App = () => {
	// https://semantic-ui.com for css styling
	return (
		<div className="ui container comments">
			<CommentDetail author="Roscoe" timeAgo="2pm" commentText="Want to Nap!" />
			<CommentDetail author="Rory" timeAgo="3pm" commentText="Want to Play!" />
			<CommentDetail author="Lulu" timeAgo="4pm" commentText="Want to Eat!" />
		</div>
	);
};

ReactDom.render(<App />, document.querySelector('#root'));
